import React from "react";

export function getData(props) {
  let { items } = props;
  fetch("http://localhost:9000/getitems")
    .then((res) => res.json())
    .then((res) => {
      const sortedActivities = res.sort(
        (a, b) => new Date(b.date) - new Date(a.date)
      );
      items = sortedActivities;
      //   setItems(sortedActivities);
      return items;
    });
}
